import React, {useState} from 'react';
import './style/App.css';
import Header from './components/Header';
import Post, {posts} from './components/Post';

function App() {

  return (
    <div className="App">
      <Header />
      {
        posts.map(post => (
          <Post username={post.username} caption={post.caption} imageUrl={post.imageUrl}/>
        ))
      }

    </div>
  );
}

export default App;
